public class Solution {
    public long NumberOfPowerfulInt(long start, long finish, int limit, string s) {
        long count = 0;
        long sValue = long.Parse(s);
        long sLength = s.Length;
        long minValue = start / (long)Math.Pow(10, sLength - 1) * (long)Math.Pow(10, sLength - 1);
        if (minValue < start) minValue += (long)Math.Pow(10, sLength);

        for (long i = minValue; i <= finish; i += (long)Math.Pow(10, sLength)) {
            long num = i + sValue;
            if (num > finish) break;
            bool isValid = true;
            while (num > 0) {
                if (num % 10 > limit) {
                    isValid = false;
                    break;
                }
                num /= 10;
            }
            if (isValid) count++;
        }
        return count;
    }
}
